func And(predicates ...predicate.DiagnosticResult) predicate.DiagnosticResult {
	return predicate.DiagnosticResult(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.DiagnosticResult) predicate.DiagnosticResult {
	return predicate.DiagnosticResult(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.DiagnosticResult) predicate.DiagnosticResult {
	return predicate.DiagnosticResult(sql.NotPredicates(p))
}
